    return(
        <>
        <div className="main-div">
            <div className="center-div">
                <br/>
                <h1>ToDo List</h1>
                <br/>
                 <input type="text" />
                 <Button className="newbtn"><AddIcon/></Button>
            </div>
        </div>

        </>
    );
};

